import React from "react";
import "./components/mystyles.css";


function clickMe() {
    alert("you clicked me!!");
}

function App() {
    return (
        <div>
            <button id="lone" className="button" onClick={clickMe}>
                Button
            </button>
        </div>
        );
}

export default App;

